import React, { Component } from 'react'
import Form from './Form'
import Events from './Events'
import Info from './Info'
import Gallery from './Gallery'
export default class AboutUs extends Component {
  render() {
    // const mystyle = {

    //   padding: "10px",
    // };
    return (
      <div>
        <div className="jumbotron jumbotron-fluid mt-5  pt-5">
          <div className="container">
            <h1 className="display-4 my-4">“There is an innovator inside of all of us.”</h1>
            <hr />
            <p className="lead my-4">With us Learning and innovation go hand in hand. The arrogance of success is to think that what you did yesterday will be sufficient for tomorrow.</p>
            <div className="text-center mt-5 pt-5">
              <button type="button" class="btn btn-warning btn-lg">Connect With Us<i class="fas fa-arrow-circle-right ml-2"></i></button>
            </div>
          </div>
        </div>
        <Info />
        <Events />

        <Gallery />

        <Form />
      </div >
    )
  }
}
